import React from "react";

function TestComponent() {
  return (
    <div className="wrapper">
      <div className="item1 card3">Start column line 1, span 3 column tracks.</div>
      <div className="item2">
        Start column line 6, span 4 column tracks. 2 row tracks.
      </div>
      <div className="item3">Start row 2 column line 2, span 2 column tracks.</div>
      <div className="item4">
        Start at column line 3, span to the end of the grid (-1).
      </div>
    </div>
  );
}

export default TestComponent;
